import React, { useEffect } from 'react'
import Meal from './Meal';
import './MealPage.css'

function MealPage() {
    const LOCAL_STORAGE_KEY = 'mealList';
    const meals = '';

    useEffect(() => {
        meals = localStorage.getItem(LOCAL_STORAGE_KEY);
    });

    if (meals.localeCompare('')) {
        return (
            <h1>No Search Results</h1>
        );
    }
    else {
        return (
            <div className="meals">
            {meals.map((meal) => {
              return <Meal key={meal.id} meal={meal} />;
            })}
            </div>
        );
    }
}

export default MealPage;
